import './../Style/Notification.css';

function AppNotification() {
  return (
    <div className="history">
        <h1>Notification</h1>
        <div className='history-table'>
            <table>
                <thead>
                    <tr>
                        <th>Shop Name</th>
                        <th>Deatils</th>
                        <th>Status</th>
                        <th>Action</th>
                    </tr>
                </thead>
                <tbody>
                    
                </tbody>
            </table>
        </div>
    </div>
  );
}

export default AppNotification;
